import React, { useState } from "react";
import "../styles/ReservarTurno.css";

const ReservarTurno = () => {
  const [docente, setDocente] = useState("");
  const [bloque, setBloque] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Turno reservado:", { docente, bloque });
    alert("Turno reservado exitosamente.");
  };

  return (
    <div className="reservar-turno-container">
      <div className="reservar-turno-card">
        <h1 className="reservar-turno-main-title">Reservar un turno</h1>
        <h2 className="reservar-turno-title">Nuevo turno</h2>
        <form className="reservar-turno-form" onSubmit={handleSubmit}>
          <label className="reservar-label">Profesor:</label>
          <select
            value={docente}
            onChange={(e) => setDocente(e.target.value)}
            required
          >
            <option value="" disabled>
              --Seleccione profesor--
            </option>
            <option value="Profesor 1">Profesor 1</option>
            <option value="Profesor 2">Profesor 2</option>
          </select>

          <label className="reservar-label">Bloque:</label>
          <select
            value={bloque}
            onChange={(e) => setBloque(e.target.value)}
            required
          >
            <option value="" disabled>
              --Seleccione bloque--
            </option>
            <option value="Bloque 1">Bloque 1</option>
            <option value="Bloque 2">Bloque 2</option>
          </select>

          <button type="submit" className="reservar-button">
            Reservar
          </button>
        </form>
      </div>
    </div>
  );
};

export default ReservarTurno;
